import React, { useState } from 'react'

const UserName = () => {
    const[name,setname]=useState('akhilesh')
    const[email,setmail]=useState('akhilesh@gmail.com')

  return (
    <>
    <div id='tmp'>

      <span>{name}</span>
      <span>{email}</span>
      <span>time</span>
    </div>
    </>
  )
}

export default UserName
